import './SignupScreen.css'

function SignUpScreen() {
  return (
    <div className='signupScreen'>
     <form>
        <input type='Email' placeholder='Enter your email'/>
        <input type='Password' placeholder='Password'/>

    </form>



    </div>
  )
}

export default SignUpScreen
